import React from "react";
import "./Card.scss";

const Card = props => {
  return (
        <div className="contenedor-Texto">
          <p>{props.texto}</p>
          <table>
            <thead>
              <tbody>

                    <tr>
                      <td>
                        {props.texto2}
                      </td>
                    </tr>
              </tbody>
            </thead>

          </table>
        </div>
  );
};

export default Card;
